import React from "react";
import { Nav, NavLink, NavMenu } from "./NavbarElements";

function Navbar () {
    return (
      <nav>
        <Link to="/">Home</Link>
        <Link to="/planner">Planner</Link>
        <Link to="inspire">Get Inspired</Link>
        <Link to="forum">Community</Link>
      </nav>
     )
  }

export default Navbar;
